package com.artsoft.bean;

public class ccc {
	
	public ccc(String mingci, String dianshiju, String bofangliang) {
		// TODO Auto-generated constructor stub
		this.mingci=mingci;
		this.dianshiju=dianshiju;
		this.bofangliang=bofangliang;
	}
	private String mingci="";
	private String dianshiju="";
	private String bofangliang="";
	public String getMingci() {
		return mingci;
	}
	public void setMingci(String mingci) {
		this.mingci = mingci;
	}
	public String getDianshiju() {
		return dianshiju;
	}
	public void setDianshiju(String dianshiju) {
		this.dianshiju = dianshiju;
	}
	public String getBofangliang() {
		return bofangliang;
	}
	public void setBofangliang(String bofangliang) {
		this.bofangliang = bofangliang;
	}
	

}
